// src/components/CoffeeDetail.js
import React, { useEffect, useState } from "react";
import { useParams, Link } from "react-router-dom";
import { CoffeeAPIService } from "../apiService";
import styled from "styled-components";

const DetailContainer = styled.div`
  padding: 20px;
  max-width: px;
  margin: auto;
  border-radius: 8px;
  /* Removed background color and shadow */
`;

const CoffeeDetailContent = styled.div`
  display: flex;
  align-items: flex-start; /* Align items to the start */
  margin-bottom: 20px; /* Spacing below the image and text */
`;

const CoffeeImage = styled.img`
  width: 100%;
  height: auto;
  max-width: 600px; /* Increased max width for the image */
  border-radius: 5px;
  margin-right: 20px; /* Jarak antara gambar dan teks */
`;

const CoffeeTitle = styled.h2`
  font-size: 2em;
  margin: 0 0 10px;
  color: #333;
`;

const CoffeeDescription = styled.p`
  font-size: 1.1em;
  margin-bottom: 15px;
  color: #555;
`;

const CoffeeDetailItem = styled.p`
  font-size: 1em;
  margin: 5px 0;
  color: #444;
`;

const FlavorList = styled.ul`
  list-style-type: square;
  padding-left: 20px;
  color: #333;
`;

const DetailHeader = styled.h4`
  margin-top: 20px;
  color: #333;
`;

const CoffeeListContainer = styled.div`
  margin-top: 40px;
`;

const CoffeeListItem = styled(Link)`
  display: flex;
  align-items: center;
  margin: 10px 0;
  text-decoration: none;
  color: #007bff;

  &:hover {
    text-decoration: underline;
  }
`;

const CoffeeListImage = styled.img`
  width: 50px; /* Ukuran gambar */
  height: auto;
  border-radius: 5px;
  margin-right: 10px; /* Jarak antara gambar dan nama */
`;

const CoffeeDetail = () => {
  const { id } = useParams();
  const [coffee, setCoffee] = useState(null);
  const [coffeeList, setCoffeeList] = useState([]);

  useEffect(() => {
    async function fetchCoffeeDetail() {
      const beans = await CoffeeAPIService.fetchCoffeeBeans();
      const selectedCoffee = beans.find((coffee) => coffee.id === parseInt(id));
      setCoffee(selectedCoffee);
      setCoffeeList(beans); // Set the entire coffee list here
    }
    fetchCoffeeDetail();
  }, [id]);

  if (!coffee) return <p>Loading...</p>;

  // Filter the coffee list to show only the same region
  const sameRegionCoffees = coffeeList.filter((coffeeItem) => coffeeItem.region === coffee.region && coffeeItem.id !== coffee.id);

  return (
    <DetailContainer>
      <CoffeeDetailContent>
        <CoffeeImage src={coffee.image_url} alt={coffee.name} />
        <div>
          <CoffeeTitle>{coffee.name}</CoffeeTitle>
          <CoffeeDescription>{coffee.description}</CoffeeDescription>
          <CoffeeDetailItem>Region: {coffee.region}</CoffeeDetailItem>
          <CoffeeDetailItem>Weight: {coffee.weight}g</CoffeeDetailItem>
          <CoffeeDetailItem>Price: ${coffee.price}</CoffeeDetailItem>
          <CoffeeDetailItem>Roast Level: {coffee.roast_level}</CoffeeDetailItem>
          <DetailHeader>Flavor Profile:</DetailHeader>
          <FlavorList>
            {coffee.flavor_profile.map((flavor) => (
              <li key={flavor}>{flavor}</li>
            ))}
          </FlavorList>
          <DetailHeader>Grind Options:</DetailHeader>
          <FlavorList>
            {coffee.grind_option.map((option) => (
              <li key={option}>{option}</li>
            ))}
          </FlavorList>
        </div>
      </CoffeeDetailContent>

      <CoffeeListContainer>
        <DetailHeader>More Coffees from the Same Region:</DetailHeader>
        {sameRegionCoffees.map((coffeeItem) => (
          <CoffeeListItem key={coffeeItem.id} to={`/coffee/${coffeeItem.id}`}>
            <CoffeeListImage src={coffeeItem.image_url} alt={coffeeItem.name} />
            {coffeeItem.name}
          </CoffeeListItem>
        ))}
      </CoffeeListContainer>
    </DetailContainer>
  );
};

export default CoffeeDetail;
